<p align="center">
	<strong><u>SURAT EDARAN WAKIL REKTOR I</u></strong></p>
<p align="center">
	<strong>Nomor: 002/SE/1.1.A/UPB/V/2020</strong></p>
<p align="center">
	<strong>TENTANG</strong></p>
<p align="center">
	<strong>PERPANJANGAN WAKTU PELAKSANAAN PERKULIAHAN <em>E-LEARNING</em></strong></p>
<p>
	&nbsp;</p>
<p>
	Menindaklanjuti Surat Edaran Nomor: 017/SE/1.1.NA/UPB/IV/2020 tertanggal&nbsp; 13 April 2020 tentang Perpanjangan Waktu Pelaksanaan Perkuliahan <em>E-learning</em> serta merujuk pada Surat Keputusan Menteri Kesehatan Republik Indonesia Nomor HK.01.07/MENKES/289/2020 Tertanggal 1 Mei 2020 Tentang Penetapan Pembatasan Sosial Berskala Besar di Wilayah Provinsi Jawa Barat dalam Rangka Percepatan Penanganan Corona Virus Disease 2019 (Covid-19), maka disampaikan hal-hal berikut :</p>
<ol>
	<li>
		Waktu pelaksanaan perkuliahan <em>E-learning</em> di lingkungan Universitas Pelita Bangsa yang semula akan berakhir pada tanggal 3 Mei 2020, <strong>diperpanjang </strong>sampai berakhirnya masa perkuliahan semester genap TA. 2019/2020.</li>
	<li>
		Surat Edaran ini akan ditinjau kembali sebelum berakhirnya masa perkuliahan semester genap TA. 2019/2020 menyesuaikan dengan Keputusan Pemerintah apabila dipandang bahwa sudah tidak ada lagi penyebaran Corona Virus Disease 2019 (Covid-19).</li>
	<li>
		Dihohon kepada seluruh dosen Universitas Pelita Bangsa untuk bisa memaksimalkan fungsi <em>E-campus</em> sebagai sarana pendukung proses pembelajaran <em>E-learning</em>, namun jika memungkinkan dipersilakan untuk menggunakan media pembelajaran daring yang lain asalkan tetap terkoordinasi dengan <em>E-campus</em>.</li>
</ol>
<p>
	Demikian surat edaran ini disampaikan untuk menjadi perhatian dan dilaksanakan dengan penuh&nbsp; tanggung jawab.</p>
<p>
	&nbsp;</p>
<p>
